柔らかく透明に仕上がるので、材質の風合いを生かしたハンドメイドアクセサリーや小物作りなどの制作にオススメです。<br>
直径0.5ｍｍの極細ノズルが細かい作業に最適です。<br>
速乾性で、材質により異なりますが約15～20分で仮接着し、約24時間で硬化します。<br>
ホルムアルデヒド・可塑剤を使用していない水性タイプ。環境・人体にやさしい成分です。<br>
ヘラ付きです。<br><br>

◆正味量17g/1本入り<br>
◆変性エチレン酢酸ビニル樹脂55％<br>
◆水性形接着剤<br>
◆接着できる素材…木材、皮革、紙、布、発泡スチロールなど<br><br>
※お使いのモニターによって実物のお色と若干異なる場合がございます。<br>
※メーカー希望小売価格はメーカーサイトに基づいて掲載しています。<br>
